(9405, 'accessary_healer_circlet_i00.png', 'Healer Circlet', NULL, 'Circlet that can be worn by the Healer class after completion of 2nd or 3rd class transfer. Cannot be worn in a subclass condition. Uses 2 hair accessory slots.', 'Диадема Целителя', NULL, 'Диадема, используемая Целителями после 2-й или 3-й смены профессии. Нельзя носить в состоянии подкласса. Занимает 2 ячейки для головных уборов.', 1, 1, 1, 'none', 'consume_type_normal'),
(9406, 'accessary_enchanter_circlet_i00.png', 'Enchanter Circlet', NULL, 'Circlet that can be worn by the Enchanter class after completion of 2nd or 3rd class transfer. Cannot be worn in a subclass condition. Uses 2 hair accessory slots.', 'Диадема Заклинателя', NULL, 'Головной убор, используемый Заклинателями после 2-й или 3-й смены профессии. Занимает 2 ячейки для головных уборов.', 1, 1, 1, 'none', 'consume_type_normal'),
(9407, 'accessary_weapon_master_circlet_i00.png', 'Weapon Master Circlet (Kamael only)', NULL, 'Circlet that can be worn by the Kamael Race only, exclusively for the Weapon Master class after completion of 2nd or 3rd class transfer. Cannot be worn in a subclass condition. Uses 2 hair accessory slots.', 'Диадема Мастера Оружия (Только для Камаэль)', NULL, 'Диадема только для расы Камаэль, используемая Мастерами Оружия после 2-й или 3-й смены профессии. Нельзя носить в состоянии подкласса. Занимает 2 ячейки для головных уборов.', 1, 1, 1, 'none', 'consume_type_normal'),
(9408, 'accessary_bow_master_circlet_i00.png', 'Bow Master Circlet (Kamael only)', NULL, 'Circlet that can be worn by the Kamael Race only, exclusively for the Bow Master class after completion of 2nd or 3rd class transfer. Cannot be worn in a subclass condition. Uses 2 hair accessory slots.', 'Диадема Мастера Лука (Только для Камаэль)', NULL, 'Диадема только для расы Камаэль и только для Лучников после 2-й и 3-й смены профессии. Нельзя носить в состоянии подкласса. Занимает 2 ячейки для головных уборов.', 1, 1, 1, 'none', 'consume_type_normal'),
(9409, 'accessory_high_phantom_mask_i00.png', 'Black Phantom Mask (Event)', NULL, 'A Phantom Mask hair accessory accented with black and gold metals. Uses 2 hair accessory slots. Event item.', 'Черная Маска Фантома - Ивент', NULL, 'Черная маска фантома сделана из черного металла и золота. Занимает 2 ячейки для головных уборов. Только для ивента.', 0, 0, 1, 'none', 'consume_type_normal'),
